description:
My Sisters Hot Friend - Jessie Lee
Added: September 21, 2010

Jessie is studying as Patrick barges into her room looking for his sister. His computer broke and he is going to steal hers. Jessie calls him out for being a scandalous person, and he just laughs. He jumps on her bed and gets comfortable. She is annoyed, but when he turns on the charm, Jessie can't help but fall for another bad boy!

